import React, { Component } from 'react';
import '../css/Home.css';

const HOMETEXT = "Hello, I’m a JavaScript Developer.";
let txt = "";
let text_len = HOMETEXT.length;
let index = 0;
let TEXTSTATE = true;

setInterval(() => {
    if(index === HOMETEXT.length){
        TEXTSTATE = false;
    }
    else if(index === -1){
        TEXTSTATE = true;
        index++;
    }

    if(TEXTSTATE){
        txt += HOMETEXT[index++];
    }
    else{
        txt = txt.substr(0, --index);
    }
}, 300)

class Home extends Component {
    render() {
        return (
            <div id="home" onClick={textRun}>
                <span>Hello, I’m a JavaScript Developer.</span>
            </div>
        )
    }
}

export default Home;
